export function updateComponentsData(data){
    return (dispatch) => {
        dispatch({
            type: 'UPDATE_COMPONENTS_DATA',
            payload: data
        });
    }
}

export function updateCreatorComponentsData(data){
    return (dispatch) => {
        dispatch({
            type: 'UPDATE_CREATOR_COMPONENTS_DATA',
            payload: data
        })
    }
}
